-Mercado eleva novamente previsões para PIB e reduz de inflação em 2022 e 2023;

-Inflação despenca pela 11ª semana seguida;

-Diesel acompanha queda da gasolina e fica 6% mais barato;

-Ibovespa dispara tocando os 111 mil pontos, se descolando do exterior e dólar recua 1,5%.

- Zero escândalos de corrupção;
- Recorde redução de impostos e de queda nos preços;
- Recordes de apreensão de drogas;
- Recorde de eficiência, transparência e resultados.

- Melhor Governo Digital das Américas;
- Agronegócio alimentando mais de 1 bilhão de pessoas no mundo;
- Um dos países que mais preservam a natureza no mundo;

- Brasil vira o sexto principal destino de investimentos no mundo;
- Maior número de brasileiros com trabalho na história;
- Brasil volta às 10 maiores economias do mundo
- Uma das gasolinas mais baratas do mundo;
- Menor número de homicídios em duas décadas;

- Recife/Londres... partiu.
- Padre Paulo Antonio de Araújo;
- Pastor Silas Malafaia;
- PR Jair Bolsonaro.

- Mais dados sobre o Governo Federal e a SEGURANÇA:

- HOMICÍDIOS - MORTES VIOLENTAS INTENCIONAIS

. A média anual de mortes violentas intencionais intencionais caiu de 61 mil anuais (2015–2018, Governos Dilma e Temer) para 48 mil anuais (2019–2021, Governo Bolsonaro);
